INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("ねぇねぇ、騎士クン\n手伝ってあげようよ～", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 0, 1, 1001, 0, 2, 0, 0, "春咲 ひより", 1.4, 1, 0, "お！\nあそこに困ってそうな人発見！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("わ、わたし、\nなに言ってるんだろ\nあはは…", "みんなみたいに\nわたしも強くならなきゃ", 1, 0, 1, 1002, 0, 2, 0, 0, "草野 優衣", 1.4, 1, 0, "大切な人を\n守れるようになりたい…って");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("少しは磨かれると思いますよ。", "フェンシングを始めてみては？", 1, 0, 1, 1003, 0, 2, 0, 0, "士条 怜", 1.4, 1, 0, "キミに必要な集中力と感性が");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("みそぎはねぇ、\nかくれんぼやりたい！", "ねぇ、にいちゃん！", 1, 0, 1, 1004, 0, 2, 0, 0, "穂高 みそぎ", 1.5, 1, 0, "今日はなにして遊ぶ？");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("私といっしょに…\nいかない？", "風宮あかりです", 1, 0, 1, 1006, 0, 2, 0, 0, "風宮 あかり", 1.4, 1, 0, "ねぇ…");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("食べ物の恨みは怖いのー", "出雲宮子なのー", 1, 0, 1, 1007, 0, 2, 0, 0, "出雲 宮子", 1.5, 1, 0, "プリンたべたいのー");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("いいよ。\n見られることは運命さ…", "ボクは虹村雪。", 1, 0, 1, 1008, 0, 2, 0, 0, "虹村 雪", 1.4, 1, 0, "キミもボクの美貌に\n吸い寄せられたんだね。");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("人呼んで「疾風の冥姫」!!", "フッ…聞いて後悔するがいい！", 1, 0, 1, 1009, 0, 2, 0, 0, "柊杏奈", 1.4, 1, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("ほんまおおきにやわ～♪", "マホマホ王国のプリンセス、\nまほ姫どす", 1, 0, 1, 1010, 0, 2, 0, 0, "姫宮 真歩", 1.5, 1, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("ここで会ったが\n100年目～！", "衣之咲璃乃です！", 1, 0, 1, 1011, 0, 2, 0, 0, "衣之咲 璃乃", 1.4, 1, 0, "生き別れたお兄ちゃんを探して\n三千世界！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("…って、お願い！\n誰にも言わないでおいて～！", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 0, 1, 1012, 0, 2, 0, 0, "柏崎 初音", 1.4, 1, 0, "ち、超能力って…\n何のことかな～？");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("ヒデサイまぢ\nGF（グッドフィーリング）～♪", "ちょす！\n美波鈴奈だよ～♪", 1, 0, 1, 1016, 0, 2, 0, 0, "美波 鈴奈", 1.4, 1, 0, "一応カリスマ読モJKやってまっす！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("でも、沖縄もとってもいいとこさー", "はいたーい。\n喜屋武香織さー。", 1, 0, 1, 1017, 0, 2, 0, 0, "喜屋武 香織", 1.4, 1, 0, "東京は遊園地みたいなところさー");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("イオちゃんって呼んでね。", "支倉伊緒です。", 1, 0, 1, 1018, 0, 2, 0, 0, "支倉 伊緒", 1.4, 1, 0, "先生って呼ばれるのは\nくすぐったいから");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("ミミをおいてかないでぇ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 0, 1, 1020, 0, 2, 0, 0, "茜 ミミ", 1.5, 1, 0, "あ！/\お兄ちゃ～ん\nまってよ～");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("ふぇぇぇぇぇん……", "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 0, 1, 1021, 0, 2, 0, 0, "栗林 くるみ", 1.5, 1, 0, "あの……\nふぇ……");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("なんてありがとうございます！", "風宮よりです。\nあああああ！", 1, 0, 1, 1022, 0, 2, 0, 0, "風宮 より", 1.4, 1, 0, "こんな私に貴重な時間を\n割いていただき、");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("私こっち行きたいー\nね、早く早くー", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 0, 1, 1023, 0, 2, 0, 0, "北条 綾音", 1.5, 1, 0, "おにいちゃんどこいくの？\nえ？");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("これて何か違う…\nあああすみません！", "わっ…わっ…私、\n天野すずめといいます！", 1, 0, 1, 1025, 0, 2, 0, 0, "天野 すずめ", 1.4, 1, 0, "ふ、不束者ですが\nどうぞ末永く…って、");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("離しませんわ………\n絶対に…!!", "……クスクス…私は\n…倉石恵理子……", 1, 0, 1, 1027, 0, 2, 0, 0, "倉石 恵理子", 1.4, 1, 0, "あなたは…運命の……\n伴侶……");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("…そうでしょ？？", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 0, 1, 1028, 0, 2, 0, 0, "佐々木 咲恋", 1.4, 1, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("あはは、\n私もまだまだだなぁ～", "桜井望だよ！\nよろしくねっ", 1, 0, 1, 1029, 0, 2, 0, 0, "桜井 望", 1.4, 1, 0, "ぇっと…\nキミ、私のこと知らないの?!");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("ショーグン、\nワタシと一緒に天下統一デース！", "デケデケデンっ！", 1, 0, 1, 1030, 0, 2, 0, 0, "ニノン・ジュベール", 1.4, 1, 0, "初めまして、\n私はニノン・ジュベール申すデス！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("おかしいですね……", "上喜しのぶです。\n手元のドクロが父です。", 1, 0, 1, 1031, 0, 2, 0, 0, "上喜 しのぶ", 1.4, 1, 0, "でもって私の隣にいるのが……\nえ、見えない？");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("そう、\nオラのボケに突っ込める相方が…！", "目指すはビッグな\nお笑い芸人だっぺ！", 1, 0, 1, 1033, 0, 2, 0, 0, "野戸まひる", 1.5, 1, 0, "けんども\nそれには足りないモンが…");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("ちょ\nちょっと一杯飲んできます…！", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 0, 1, 1034, 0, 2, 0, 0, "綾瀬 ゆかり", 1.4, 1, 0, "ちょっと緊張しちゃって…");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("これ以上お話しすることは…\nないです！", "氷川鏡華…です", 1, 0, 1, 1036, 0, 2, 0, 0, "氷川 鏡華", 1.5, 1, 0, "知らない人とは話しちゃいけないので");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "柏崎…栞です。", 1, 0, 1, 1038, 0, 2, 0, 0, "柏崎 栞", 1.4, 1, 0, "……あ、アラーム。");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("野に咲く花が、\n唯一の話相手です。", "ふ、双葉碧です。", 1, 0, 1, 1040, 0, 2, 0, 0, "双葉 碧", 1.4, 1, 0, "私、一人も友達がいなくて……");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("そう思っています。", "三角千歌です。", 1, 0, 1, 1042, 0, 2, 0, 0, "三角 千歌", 1.4, 1, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("う、疑ってすまなかったな…", "安芸真琴だ。", 1, 0, 1, 1043, 0, 2, 0, 0, "安芸 真琴", 1.4, 1, 0, "あぁ？\nお前のそいつの仲間か？");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "わらわこそは夜を総べる者！", 1, 0, 1, 1044, 0, 2, 0, 0, "イリヤ・オーンスタイン", 1.4, 1, 0, "生けとし生ける全ての者よ！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("ｌク、クウカに何かご用ですか!?", "そこで騎士は妖精を乱暴に……", 1, 0, 1, 1045, 0, 2, 0, 0, "遠見 空花", 1.4, 1, 0, "ぐふふふふ……はっ！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("う～ん…\n猫ってホントに最高にゃ～♪", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 0, 1, 1046, 0, 2, 0, 0, "宮坂たまき", 1.4, 1, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("…と思ったら\nバイトの時間だ！\nまたあとでね！", "大神美冬よ！", 1, 0, 1, 1048, 0, 2, 0, 0, "大神 美冬", 1.4, 1, 0, "それでは早速クエストに…");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("お姉ちゃんがぜ～んぶ\nやってあげるからね！", "星野静流だよ！", 1, 0, 1, 1049, 0, 2, 0, 0, "星野静流", 1.4, 1, 0, "クエストもバトルも\n掃除も洗濯も");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "アタシは玉泉美咲。", 1, 0, 1, 1050, 0, 2, 0, 0, "玉泉美咲", 1.5, 1, 0, "見ての通りの\nセクシー美少女で");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("？？？？", "？？？", 1, 0, 1, 1052, 0, 2, 0, 0, "リマ", 1.4, 1, 0, "？？？？");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 1, 0, 1, 1053, 0, 2, 0, 0, "モニカ・ヴァイスヴィント", 1.5, 1, 0, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 1, 0, 1, 1058, 0, 2, 0, 0, "ペコリーヌ", 1.5, 1, 0, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 1, 0, 1, 1059, 0, 2, 0, 0, "コッコロ", 1.5, 1, 0, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES ("そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 1, 0, 1, 1060, 0, 2, 0, 0, "キャル", 1.5, 1, 0, "菓子でつろうなどと\n稚拙な策を……");
